import React from 'react';


const Home1 = ({data}) => {
    const background=`${data?.weather[0]?.main}.jpg`;
    const icon=`${data?.weather[0]?.main}.png`
    console.log(data)
    return (
        <div className="container-sm">
            <div  className='background' style={{backgroundImage:`url(img/${background})`}}>
                <div className="container-fluid" style={{width:"50%"}}>
                    <div className="card text-center card-background" >
                        <div className="card-body">
                            <img src={`img/${icon}`}/>
                        </div>
                    </div>
                </div>
            </div>
        </div>
        
    );
};

export default Home1;
